import React, { memo } from 'react';
import CustomLink from '../customLink/CustomLink';

const Menu = () => {
    return <>
        <nav className="nav">
            <a href="/" className="site-title">Main</a>
            <ul>
                <CustomLink>Monitor activity</CustomLink>
                <li>
                    <a href="/materials">Materials</a>
                </li>
            </ul>
        </nav>
    </>;
}

export default memo(Menu);
